function parseAnnotationsOutput(annotations) {
	if(annotations !== null && annotations !== undefined) {
		annotations = annotations.map(item => {
			item.added_on = iml.parseDate(item.added_on, 'X')
			return item
		})	
	}
	return annotations
}
